<!DOCTYPE html><html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en-us"><head><style type="text/css"> @import url('http://www.gnu.org/software/emacs/manual.css');</style></head><body style="padding:1rem;"><strong>ewoc-goto-next</strong> is a compiled Lisp function in `<code>ewoc.el</code>'.</br>
</br>
(ewoc-goto-next <u>EWOC</u> <u>ARG</u>)</br>
</br>
Move point to the <u>ARG</u>th next element in <u>EWOC</u>.</br>
Return the node (or nil if we just passed the last node).<br/><br/><br/><br/><small>A courtesy of <a href="http://endlessparentheses.com/">Endless Parentheses</a>.</small></body></html>
